import React from "react";
import { connect } from "react-redux";
import { createStructuredSelector } from "reselect";
import PreviewCollection from "../../components/preview-collection/preview-collection.component";
import { selectShopData } from "../../redux/shop/shop-selector";

const Shop = () => {
  const { collection } = this.state;

  return (
    <div className="shop-page">
      {collection.map((val) => {
        return (
          <PreviewCollection key={val.id} title={val.title} items={val.items} />
        );
      })}
    </div>
  );
};

const fun1 = createStructuredSelector({
  shopdata: selectShopData,
});

export default connect(fun1)(Shop);
